import Modal from "../UI/Modal";
import Search from "./Search";

const AddImageWindowForLarge = (props) => {

  return (
    <Modal onClose={props.onClose}>
      <h3>ADD Image</h3>
      <p>Edit your media files here</p>
      

      <Search/>
     
    </Modal>
  );
};

export default AddImageWindowForLarge;
